import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor(){
    super();
    this.state = {
      name: 'NNZz',
      company: 'ZTM'
    }
  }

  render() {
      return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Hi {this.state.name}, I work at {this.state.company}.
          </p>
          console.log()
          <button onClick={() => {
            this.setState({
              name: 'Andrei'
            });
          }}>
            Change name
          </button>

        </header>
      </div>
    );
  }

}

export default App;
